  false,\n\t\"url\": null,\n\t\"notes\": \"Polygon data for all major shipping lanes
  associated with all ports in the Gulf of Mexico are presented. These layers were
  modified from GIS data acquired from the U. S. Department of the Interior Bureau
  of Ocean Energy Management (BOEM) website. Although file description reports are
  available, no FGDC-compliant metadata are available for the original files from
  BOEM. The current layers are non-projected with coordinates in decimal degrees.\",\n\t\"license_title\":
